  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Litchfield Wetland Management District for the
  next 15 years. This plan outlines the District vision and purpose and describes
  how Litchfield Wetland Management District will contribute to the overall mission
  of the Refuge System. The plan provides an introduction to the District, an overview
  of the CCP process, information about the environment, information about the management
  direction, and strategies for implementation and monitoring. Key planning issues
  include: wildlife management, habitat management, public use, and operations.\",\n\t\"license_title\":
